import React from 'react';
import logo from './logo.svg';
import './App.css';


function Todo({ todo }) {
  return (
    <div className="todo">
      { todo.text }
    </div>
  )
};


function App() {
  const [todos, setTodos] = React.useState([
    {text: "Learn React"}
  ]);

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
    </div>
  );
}

export default App;
